def find_permutation(n, l, r, s):
    from collections import defaultdict
    p = list(range(1, n + 1))
    w = p[:r - l + 1]
    b = sum(w)
    h = sum(p[-(r - l + 1):])
    if not b <= s <= h:
        return -1
    c = s + b
    m = c % (r - l + 1)
    w[-1] = p[r - l] + c // (r - l + 1)
    for i in range(len(w) - 2, -1, -1):
        w[i] = w[i + 1] - 1
    for i in range(len(w) - 1, -1, -1):
        if not m:
            break
        m -= 1
        w[i] += 1
    f = defaultdict(int)
    for i in w:
        f[i] = 1
    a = [0] * n
    for i in range(l, r + 1):
        a[i - 1] = w.pop()
    for i in range(n):
        if not a[i]:
            for j in range(len(p)):
                if f[p[j]] == 0:
                    a[i] = p.pop(j)
                    break
    return a

